#!/usr/bin/env python3


SZAM = ""


def main():
    reszek = list(zip(SZAM, SZAM[1:], SZAM[2:], SZAM[3:], SZAM[4:]))
    max = int(reszek[0][0]) * int(reszek[0][1]) * \
        int(reszek[0][2]) * int(reszek[0][3]) * int(reszek[0][4])
    for i in range(1, len(reszek)):
        tmp = int(reszek[i][0]) * int(reszek[i][1]) * \
            int(reszek[i][2]) * int(reszek[i][3]) * int(reszek[i][4])
        if tmp > max:
            max = tmp
    print(max)

##############################################################################


if __name__ == "__main__":
    main()
